import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import Comp01 from './comp/Comp01';
import Comp02 from './comp/Comp02';
import Comp03 from './comp/Comp03';
import Comp04 from './comp/Comp04';
import Comp05 from './comp/Comp05';
import Comp06 from './comp/Comp06';
// import Comp07 from './comp/Comp07';
// import Comp08 from './comp/Comp08';
// import Comp09 from './comp/Comp09';
import reportWebVitals from './reportWebVitals';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Comp06 />
    <Comp05 />
    <Comp04 />
    <Comp03 />
    <Comp02 />
    <Comp01 />
    <App />
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
